import React from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";


const Map = ({ data }) => {


  return (
    <div className="map-container"> {/* Wrap MapContainer with a div */}
     <MapContainer
      center={[51.505, -0.09]} // Default center
      zoom={2}
      style={{ height: "500px", width: "100%" }}
    >
      {/* TileLayer for OpenStreetMap */}
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
      />

      {/* Render markers only if VehicleLocation is available */}
      {data.map((item, index) => {

        if (item.VehicleLocation) {

          const locationParts = item.VehicleLocation.split(" ");

          if (locationParts.length === 2) {
            const [lng, lat] = locationParts.map((coord) => parseFloat(coord));
            return (
              <Marker key={index} position={[lat, lng]}>
                <Popup>
                  {item.Make} {item.Model} - {item.City}, {item.State}
                </Popup>
              </Marker>
            );
          } else {
            console.warn(`Invalid VehicleLocation format for ${item.Make} ${item.Model}`);
            return null;
          }
        }
        return null; // Return null if VehicleLocation is not available
      })}
    </MapContainer>
    </div>
  );
};

export default Map;
